		  font-weight: 500;
		  line-height: 24px;
		  text-align: center;
		  text-decoration: none;
		  white-space: nowrap;
		}

		[data-netlify-identity-button] a:focus {
		  background-color: #007a70;
		  text-decoration: none;
		}

			display: flex;
		}

			margin-right: 16px;
		}

			list-style-type: none;
			display: inline-block;
		}

			display: block;
			position: relative;
			width: 192px;
			height: 24px;
			padding: 8px;
			outline: 0;
			cursor: pointer;
			border: 2px solid #007a70;
			border-radius: 4px;
			background-color: #00ad9F;

			line-height: 24px;

		[data-netlify-identity-menu] a:focus {
		  background-color: #007a70;
		  text-decoration: none;
		}

		}

			color: #2d3b41;
			display: block;
			margin-top: 8px;
